import './Login.css'

 function Login(){
     
    const submitHandler = (event) => {
        fetch(`http://localhost:9000/login/${encodeURIComponent(event.currentTarget.elements.email.value)}/${encodeURIComponent(event.currentTarget.elements.password.value)}`)
        .then(response => response.json())
        .then(data => {
            console.log(data)
        })
    }

    return (
        <div className='login'>
            <div className='background'>
                <form className='loginForm' onSubmit={submitHandler}>
                    <p className='title'>Log In</p>
                    <input type='email' placeholder='Email Address' className='email' id='email' required></input>
                    <input type='password' placeholder='Password' className='pass' id='password' required></input>
                    <button className='submit'>Log In</button>
                </form>
            </div>
        </div>
    )
}

export default Login;
